import React from 'react';

function Header() {
    return (
        <header>
            <h1>EasyBook</h1>
            <nav>
                <ul>
                    <li><a href="#">About</a></li>
                    <li><a href="#">Sign Up/Log In</a></li>
                </ul>
            </nav>
        </header>
    );
}

export default Header;
